import React from 'react';
import CoffeeToGo from '../images/coffee-cup.png';

function Product(){
    return (<div>
        <div className="container bg-yellow-900">
            <img src={CoffeeToGo} alt="Coffee Cup" />
            <h1>Coffee</h1>
            <p>Small: $0.99</p>
            <p>Medium:$1.25</p>
            <p>Large: $2.00</p>
        </div>
    </div>);
}

export default Product;
